VALUES ('3760020501532', 'Soupe Au Chou Son D\'avoine - 300 GR - Nature System', 'Mode d\'emploi : Versez une cuillère doseuse bombée de poudre (log) dans un grande tasse, rajoutez 150 ml d\'eau chaude puis remuez. Votre soupe est prête I Ingrédients pour soupe déshydratée : légumes* 32,2% [chou blanc* 13,5%, potimaron*, ail*], mattodextrine de maïs*, fibre d\'acacia*, son d\'avoine* 10% : gomme de guar, gomme xanthane - arôme naturel (célen), dextrose*, poivre* de l\'agrionre biologique, hupe instantanée biologique aux légumes déshydratés et son d\'avoinet Ma journée minceur avec NATURESYSTEMO Petit déjeuner : 1 galette au son d\'avoine bio - 1 boisson chaude non sucrée I fruit ou 1 jus de fruit frais - 1 laitage 0%. Pause du matin : 1 poignée d\'amandes. Déjeuner : 1 soupe au chou au son d\'avoine bio - 1 viande maigre gfllléeetdes égumes vapeur citronnés - 30 g de fromage maigre et I tranche de pain complet, )ause de 16 h : thé + 1 pomme + 1 carré de chocotat noirs )îner: 1 soupe au chou son d\'avoine bio avant 1 repas léger.', 'https://static.openfoodfacts.org/images/products/376/002/050/1532/front_fr.6.400.jpg', '1.5', '0', '52', '16', '23', '6.6', '5.7', '2.24409448818898', '', '0');

