VALUES ('3760024280198', 'glaces fermières', 'Fance deline Glaces Fermières Poids: 430 g La Ferme du Bosc Félix et Carine BOSSUT-HAMBLENNE 11420 MAYREVILLE FRANCE Depuis 1995, nous vous proposons toute une gamme de crèmes glacées réalisées avec le lait de brebis produit créons nous- atiiranee sur notre ferme. Nous même nos recettes en étroite collaboration avec nos agriculteurs ou artisans de notre territoire afin de sélectionner des ingrédients d\'exception. privilégiant une collègues : 3760024 280198! CONSEIL DE DÉGUSTATION: Afin que nos glaces révèlent toutes leurs qualités gustatives, nous vous conseillons vivement de les placer au réfrigérateur au moins 15 minutes avant de les déguster. CONSERVATION: A conserver à -18°C. Une fois décongelé, ce produit ne peut être recongelé. To be kept at -18°C. Once thawed, this product must not be frozen again. A consommer de préférence avant le: voir le côté de la barquette Best before use: see on side of the container. INGRÉDIENTS: Lait entier de brebis 65%, saccharose, glucose, lait écrémé de brebis en poudre, pure pâte de réglisse 5%, gélifiants farine de graines de caroube, de guar, carraghénanes (extraits d\'algues), mono et diglycérides d\'acides gras (origine végétale). Fabriqué dans un atelier utilisant lait, ceufs, arachides, fruits à coques, gluten, produits à base de soja. FR 11.226.001 CE La Ferme du Bosc Félix et Carine BOSSUT-HAMBLENNE - 11420 MAYREVILLE Tél. 04 68 60 67 07 -email: info@audeline.com f BENVENUE alaferme Suivez l\'actualité d\'Audeline sur notre site www.audeline.com et sur 7usuo ogouadan) sooD wg.asntg sannu t aboc cpyp jo sno soucudo ol losopuooNsre pub ouQu 0oDAN', 'https://static.openfoodfacts.org/images/products/376/002/428/0198/front_fr.6.400.jpg', '', '', '', '', '', '', '', '', '', '1');

